import React from 'react'
import "./Button.css";

const Button = ({ danger, text, ...btnProps }) => {
  return (
    <button
      className={danger ? "Button-danger" : "Default-button"}
      {...btnProps}
    >
      {text}
    </button>
  );
};

export default Button;
